import Container from '../../Container.jsx';
import './'



function Footer() {
  return (
     <footer>
<Container>
     <div className="footerbox">
        <div className="contactus">

        </div>
        <div className="footerlogo">

        </div>
        <div className="utilitypage">

        </div>
     </div>

</Container>
     </footer>
  );
}

export default Footer;
